Property.Value:
BEGIN
DELETE FROM dbo.Pokemon WHERE Id = @Id;
END

CREATE PROCEDURE [dbo].[spPokemon_Delete]
	@Id int
AS

BEGIN
SELECT [Id], [Name], [Type1], [Type2], [Hp], [Att], [Def], [SpAtt], [SpDef], [Spd] FROM dbo.Pokemon WHERE Id = @id;
END

CREATE PROCEDURE [dbo].[spPokemon_Get]
	@id int
AS

BEGIN
SELECT [Id], [Name], [Type1], [Type2], [Hp], [Att], [Def], [SpAtt], [SpDef], [Spd] FROM dbo.Pokemon;
END

BEGIN
INSERT INTO dbo.Pokemon([Name], Type1, Type2, Hp, Att, Def, SpAtt, SpDef, Spd) VALUES (@Name, @Type1, @Type2, @Hp, @Att, @Def, @SpAtt, @SpDef, @Spd);
END

CREATE PROCEDURE [dbo].[spPokemon_Insert]
	@Name NVARCHAR(25),
	@Type1 NVARCHAR(10),
	@Type2 NVARCHAR(10) NULL,
	@Hp INT,
	@Att INT,
	@Def INT,
	@SpAtt INT,
	@SpDef INT,
	@Spd INT
AS

BEGIN
UPDATE dbo.Pokemon set [Name]=@Name, Type1=@Type1, Type2=@Type2, Hp=@Hp, Att=@Att, Def=@Def, SpAtt=@SpAtt, SpDef=@SpDef, Spd=@Spd WHERE Id = @Id;
END

