CREATE PROCEDURE [dbo].[spPokemonUsage_Delete]
	@param1 int = 0,
	@param2 int
AS

BEGIN
SELECT [Id], [Generation], [Format], [PokemonId], [RawCount], [Abilities], [Items], [Spreads], [Moves], [Teammates], [ChecksAndCounters] FROM dbo.PokemonUsage WHERE Id = @Id;
END

CREATE PROCEDURE [dbo].[spPokemonUsage_Get]
	@Id int
AS

BEGIN
SELECT [Id], [Generation], [Format], [PokemonId], [RawCount], [Abilities], [Items], [Spreads], [Moves], [Teammates], [ChecksAndCounters] FROM dbo.PokemonUsage;
END

BEGIN
SELECT [Id], [Generation], [Format], [PokemonId], [RawCount], [Abilities], [Items], [Spreads], [Moves], [Teammates], [ChecksAndCounters] FROM dbo.PokemonUsage WHERE Generation=@Generation AND [Format]=@Format;
END

